import { Button, Box, IconButton, Badge, Typography } from "@material-ui/core"
import { useNavigate, Link } from "react-router-dom"
import { makeStyles } from '@material-ui/core/styles';
import { useAppStateContext } from '../../contexts/appStateContext';
import UserDrawer from "../UserDrawer/UserDrawer";
import apiClient from '../../services/apiClient';
import FacebookIcon from '@material-ui/icons/Facebook';
import TwitterIcon from '@material-ui/icons/Twitter';
import InstagramIcon from '@material-ui/icons/Instagram';
import classnames from 'classnames';
import { white } from "color-name";
import './Footer.css'; 
import pizzaImg from "../../assets/pizza.png"
const useStyles = makeStyles((theme) => ({
  root: {
    '& > *': {
      margin: theme.spacing(1),
      paddingLeft: "30px",
      backgroundColor: "#fffff"
    },
  },
  customButton: {
    border: "3px solid",
    borderColor: "#2EDBFD !important",
    backgroundColor: "#000000",
    color: "white !important",
    "&:hover": {
      color: "black !important",
      backgroundColor: "#2EDBFD",
    }
  },
  largeIcon: {
    width: 60,
    height: 60,
  }
}));


export default function Footer() {
  const { appState, setAppState } = useAppStateContext()
  const navigate = useNavigate()
  const classes = useStyles()

  const emptyUser = async () => {
    await apiClient.logoutUser()
    navigate("/login")
    setAppState({
      isAuthenticated: false,
    })

  }
  return (
    <Box display="flex" justifyContent="space-between" pt={2} px={5}>
        <Box className={classes.root}>
        <FacebookIcon className={classes.largeIcon}/>
        <TwitterIcon/>
        <InstagramIcon/>
        </Box>
       <Typography variant="body1" color="inherit">
                Â© 2021 Simply Pizza.
        </Typography>

    </Box>

  )
}
